const RadioSet = () => {
    return (
        <div>
            <input type="radio" name="radio-set" id="radio-1"/>
            <label htmlFor="radio-1">Radio 1</label>
            <input type="radio" name="radio-set" id="radio-2"/>
            <label htmlFor="radio-2">Radio 2</label>
            <input type="radio" name="radio-set" id="radio-3"/>
            <label htmlFor="radio-3">Radio 3</label>
        </div>
    )
}

export default RadioSet
